import React from "react";
import Navbar from "./Navbar";
import "./Projects.css";


import project1 from "/Users/aniruddhkapileshwari/Desktop/Deepa-pot/deepa-portfolio/src/assets/11.png";
import project2 from "/Users/aniruddhkapileshwari/Desktop/Deepa-pot/deepa-portfolio/src/assets/10.png";
//import project3 from "./assets/project3.jpg";
//import project4 from "./assets/project4.jpg";
//import project5 from "./assets/project5.jpg";
//import project6 from "./assets/project6.jpg";
//import project7 from "./assets/project7.jpg";

const Projects = () => {
    const projectData = [
        { id: "01", title: "Formula One Grand Prix Race Circuit",subtitle:"Masters 1st term project", img: project1, link: "/about" },
        { id: "02", title: "Urban Campus Housing",subtitle:"Masters 1st term project", img: project2 },
        //{ id: "03", title: "Jinbocho Sliding Park", img: project3 },
        //{ id: "04", title: "Fakescapes", img: project4 },
        //{ id: "05", title: "The Component", img: project5 },
        //{ id: "06", title: "Pixelate: Analog", img: project6 },
        //{ id: "07", title: "Boom! On the Go", img: project7 },
    ];

    return (
        <>
            <Navbar />
            <div className="project-hero">
                <div className="project-hero-content">
                    <div className="project-hero-year">
                        <p>2019</p>
                        <div className="line"></div>
                        <p>2024</p>
                    </div>
                    <div className="project-hero-title">
                        <h1>PROJECTS</h1>
                        <p>of Deepa Devangmath</p>
                    </div>
                </div>
            </div>

            {/* New Section */}
            <div className="table-of-contents-section">
            <h1>Recent</h1>

                <h2> Work</h2>
                <p>Click to view projects</p>
                <div className="contents-list">
                    {projectData.map((project) => (
                        <a 
                        href={project.link} 
                        key={project.id} 
                        className="content-item"

                        rel="noopener noreferrer" // Security for external links
                    >
                        <div className="content-image">
                            <img src={project.img} alt={project.title} />
                        </div>
                        <div className="content-details">
                            <span>{project.id}</span>
                            <h3>{project.title}</h3>
                            <p>{project.subtitle}</p>
                        </div>
                    </a>
                    ))}
                </div>
            </div>
        </>
    );
};

export default Projects;
